import React from "react";
import CardData from "./CardData";
import Cards from "./Cards";
const CardApp = () => {
  return (
    <>
      {CardData.map((val, ind) => {
        return (
          <Cards
            key={ind}
            imgsrc={val.imgsrc}
            title={val.title}
            link={val.link}
          />
        );
      })}
    </>
  );
};
export default CardApp;
